import React from 'react';
import styles from './Messages.module.css';
import MessegesAndrey from './MessegesAndrey/MessegesAndrey';
import { NavLink } from 'react-router-dom';
import MessegesShaha from './MessegesShaha/MessegesShaha';

function Messages() {
    return (
      <div>
        <h4 className={styles.headline}>Messages</h4>
        <div className={styles.messages}>
            <ul className={styles.dialogs}>
              <NavLink to='/messages/andrey'><li>Andrey</li></NavLink>
              <NavLink to='/messages/saha'><li>Shaha</li></NavLink>
              <NavLink to='/messages/vlad'><li>Vlad</li></NavLink>
              <NavLink to='/messages/denis'><li>Denis</li></NavLink>
              <NavLink to='/messages/daniil'><li>Daniil</li></NavLink>
              <NavLink to='/messages/oleg'><li>Oleg</li></NavLink>
            </ul>
            <MessegesAndrey />
            <MessegesShaha />
        </div>
      </div>
    )
  }

export default Messages;
